import React, { Component } from 'react'




class Student extends Component {
    constructor(props){
        super(props);
        this.state = {
            name:'Lathesh',
            roll:this.props.roll
        }
     
    }
    
    show = () => {
        console.log("Half dude", this)
    }


    render(){
        return (
            <div>
                <h1>Hello {this.state.name} Your roll: {this.state.roll}</h1>
                <button onClick={this.show}>Click</button>
            </div>
        )
    }
 
}

export default Student;
